from schedule_search.controller.mcts_search.procedure.action import \
    ActionType
from schedule_search.controller.mcts_search.procedure.action import \
    SearcherAction


def proc(progress):
    """

    :param progress:
    """
    next_todo = SearcherAction(stage_index=progress.todo.stage_index,
                               action_type=ActionType.emit_insn)
    progress.todo = next_todo
